INSERT INTO `notify` VALUES (13,'FAQ: 1E7 2015 Q7 - \'I\' is the moment of inertia of the object in question, which in this case is a rectangle. The formula for \'I\' of a rectangle is bd^3/12 or (breadth x depth^3)/12. Any more questions just leave a suggestion and we\'ll do our best to answer!  ','2017-04-13 14:23:03');
