INSERT INTO `suggestion` VALUES (12,'In \"Q1 (a) i\" of \"1E2 2015 Solutions\", the limit in incorrect. It should be \"Lim sin(7x)/tan(3x)\" instead of \"Lim sin(7x)/tan(7x)\" \nTherefore the method in which the limit is resolved should be different (L\'Hôpital maybe?).',317,'Garbhan','2017-04-20 10:55:17'),(14,'1e2 2015 Qb(i) tan7x should be tan3x',267,'Michelle','2017-04-20 16:29:52'),(18,'If in the solutions, the variables could be laid out and labelled, I think that would help. It\'s already done in some solutions.',126,'Keadi ','2017-04-27 18:22:27'),(20,'1E5 2015 Q3(b) should be 32.29atm',267,'Michelle','2017-04-30 13:56:09'),(22,'The link to the exam is for Experimental Methods. The correct link is: https://www.tcd.ie/academicregistry/exams/assets/local/past-papers2014/ME/ME1E071.pdf',121,'Sean Doyle','2017-05-08 17:26:45'),(23,'My bad correct link is https://www.tcd.ie/academicregistry/exams/assets/local/past-papers2013/ME/ME1E071.pdf',121,'Sean Doyle','2017-05-08 17:28:06'),(24,'https://examhack.ie/paper/8\nQ1 (b) (ii): The limit tends to 1, but in the solution given the limit tends to 0. The answer therefore should be 4, not -2',317,'Garbhan','2017-05-15 15:03:27'),(25,'Hi! For 2016 Q1b and 2015 Q1c could you explain how you found the tension and where the coeffients in the formulae came from?',264,'Laura Tierney','2017-09-05 18:54:30');
